import React from 'react';
import {Tile} from '../Shared/Tile';
import {Appcontext} from '../App/AppProvider';
import ReactHighCharts from 'react-highcharts'

export default function(){
<Appcontext.Consumer>
<Tile>
<ReactHighCharts config = {highchartsConfig()}/>

</Tile>
</Appcontext.Consumer>
}
